⁣
I always love looking back & seeing how far I’ve come; it also helps remind me that I still have a lot of work to do, but also that I have the ability to put in the work needed.⁣
⁣
The physical changes I’ve achieved are fun & I love them, but my favorite changes I’ve made have been mentally over this time. Mentally I’m not the same person in these 2 pics & I’m definitely not the same person mentally that I was when I started with @jmihalyfit - he’s made me into a better athlete mentally & on a whole other level.⁣
⁣
When I first started my mental fortitude wasn’t anything near what it is now, I’ve built it over the last 3-5 years & I’ll continue to build it as long as I want/need to. 
⁣
That’s the thing about mental fortitude - oftentimes it’s already inside of us it just takes building onto & waking it up@it for it to grow. The more consistency, discipline, & hard work you put in the more it grows. ⁣
⁣
The more you say “no” to the instant gratification & hold out for the long term gain the easier it’ll be to say “no.” The more you push through the hard times, the easier the hard times will get. The more you stop getting in your own way & sabotaging yourself, you’ll realize the things you need to do to be successful & you’ll just do them - no questions & no excuses added. ⁣
⁣
It becomes a lifestyle. It becomes something you weigh - will X be worth it now or long term will X be worth it (whatever your goals are). I know long term THAT moment I envision in my head will be worth more then anything I get out of short term satisfaction, which is why I do what I do. ⁣
⁣
Surprisingly during that 1st prep I wanted to quit 5 weeks out & never do it again... 3 years later here we are. I’ve failed, I’ve fallen off track, & I’ve done unnecessary stuff (we live & learn) but I’ve never given up & that’s what has allowed for the growth that I’ve had. ⁣
⁣
