After 6 years of running, I finally got the courage to run in a sports bra for the first time. Like many people, I've always struggled with body image and criticize every jiggly bit on my body. The thought of running without a shirt and letting others see my stomach was terrifying to say the least. 

However, I've recently started seeing more women empower themselves to say "F*** it!", if guys can run shirtless, why can't we?!? Also, it's super hot!!

So, the other day I decided to be brave and do the second half of my evening run without a shirt. I'm not going to lie, I avoided eye contact with others running by, but it felt really nice to be vulnerable and go for it. 🧡

While I still am super self-conscious of my midsection, I am sharing this for all of the other women- and men- out there to say it's okay to not be fully happy with where your body is, however we need to APPRECIATE and CELEBRATE what it can accomplish- like running crazy amounts of miles. 💥

So while my body will never be "perfect", it's a badass machine and I love it 🙌🏻🌟 
